import React from "react";
import styled from "styled-components";

const Bar = styled.div`
  display: grid;
`;

const NavBar = () => {
  return (
    <Bar>
      <div>Home</div>
      <div>Home</div>
      <div>Home</div>
    </Bar>
  );
};

export default NavBar;
